const foods = [
  {
    id: '1',
    name: 'TianTian',
    ingredients: 'Chicken Rice',
    price: 4,
    image: require('../assets/catergories/TianTian.png'),
  },
  {
    id: '2',
    name: 'No.1 Hokkien Mee',
    ingredients: 'Hokkien Mee',
    price: 5.10,
    image: require('../assets/catergories/hokkienmee.png'),
  },
  {
    id: '3',
    name: 'SG Best Char Kuay Teow',
    ingredients: 'Char Kuay Teow',
    price: 5.10,
    image: require('../assets/catergories/kwayteow.png'),
  },
  {
    id: '4',
    name: 'Wee Nam Kee',
    ingredients: 'Chicken Rice',
    price: 6.55,
    image: require('../assets/catergories/WeeNamKee.png'),
  },
];

export default foods;
